import React from "react";
import { Link } from "react-router-dom";

const NotFoundPage = () => {
  return (
    <div className="flex flex-col gap-2">
      404 not Found
      <Link to="/">Home</Link>;
    </div>
  );
};

export default NotFoundPage;
